INSERT INTO product (product_name, product_price, product_desc, product_image, count_in_stock, rating, num_reviews, commande_id) VALUES 
('ESN Iso Whey Protein', 129.00, 'This whey protein is an isolate obtained by tangential microfiltration. Its value lies in its high protein content and reduced carbohydrate and lipid content. The many available flavors offer a varied choice to find your favorite isolate.', 'data:image/jpeg;base64,', 5, 0, 0, null),
('Optimum Nutrition Gold Standard Whey Protein', 49.99, 'This whey protein is made with whey protein isolates, which are the purest form of whey protein that exists. Each serving provides 24 grams of protein and 5.5 grams of BCAAs to support muscle growth and recovery.', 'data:image/jpeg;base64,', 10, 0, 0, null),
('MuscleTech NitroTech Whey Protein Powder', 69.99, 'This whey protein is enhanced with creatine and amino acids to support muscle growth and recovery. Each serving provides 30 grams of protein and 6.8 grams of BCAAs to fuel your muscles.', 'data:image/jpeg;base64,', 10, 0, 0, null),
('Myprotein Impact Whey Protein Powder', 39.99, 'This whey protein is a great value for the money. It contains 21 grams of protein per serving and is available in a variety of flavors.', 'data:image/jpeg;base64,', 2, 0, 0, null),
('Scitec Nutrition 100% Whey Protein Professional', 79.00, 'Scitec Nutrition 100% Whey Protein Professional is a blend of whey protein concentrate and whey protein isolate. It is a high-quality protein powder that is designed to support muscle growth and recovery. Each serving provides 22 grams of protein, 2 grams of carbohydrates, and 1 gram of fat.', 'data:image/jpeg;base64,', 10, 0, 0, null),
('Bulk Powders Pure Whey Protein', 69.00, 'Bulk Powders Pure Whey Protein is a high-quality protein powder made from whey protein concentrate. It is designed to support muscle growth and recovery, with 24 grams of protein per serving. It is available in a range of delicious flavors to suit your taste preferences.', 'data:image/jpeg;base64,', 15, 0, 0, null),
('Whey Concentrate Protein Powder', 39.00, 'This classic whey protein powder is made from high-quality whey concentrate. Its perfect for building lean muscle and boosting your protein intake. Try it in sweet banana flavor!', 'data:image/jpeg;base64,', 3, 0, 0, null),
('Hydro Whey Protein Powder', 79.00, 'This fast-acting hydrolyzed whey protein powder is perfect for post-workout recovery. Its absorbed quickly by the body to deliver amino acids to your muscles. Try it in delicious strawberry flavor!', 'data:image/jpeg;base64,', 12, 0, 0, null);
